import React from "react";

const ImageLinkForm = () => {
	return (
		<div>
			<p className="f3">
				{
					"This Magic Brain will detect faces in your pictures. Git it a try."
				}
			</p>
			<div>
				<input type="tex" />
				<button>Detect</button>
			</div>
		</div>
	);
};

export default ImageLinkForm;
